import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';

function hardwSevenComponent() {
    return (
        <div>
            <h3>Робот механизмдері</h3>
            <Link to="/hardwf/one">
                <button className='b1'>
                    Drivetrains
                </button>
            </Link>
            <Link to="/hardwf/two">
                <button className='b2'>
                    Lifts
                </button>
            </Link>
            <Link to="/hardwf/three">
                <button className='b3'>
                    Intakes
                </button>
            </Link>



        </div>
    );
}

export default hardwSevenComponent;
